na hai  \nkuch jaane agar to itna ke yeh tera deewana hai\nre mann mera ... mane na mann mera\n\nEros International presents a Next Gen Films production 'Table No.21' directed by Aditya Datt featuring Paresh Rawal, Rajeev Khandelwal \u0026 Tena Desae in the lead roles. The film is produced by Sunil Lulla \u0026 Viki Rajani.\n\nTable No.21 is all set to release in theatres on January 4th. Don't miss the game!!\n\nTo watch more log on to http://www.erosnow.com/\n\nFor all the updates on our movies and more:\nhttps://twitter.com/#!/ErosNow\n/erosnow\nhttps://plus.google.com/+erosentertai...\nhttp://www.dailymotion.com/ErosNow /erosnow","commandRuns":[{"startIndex":41,"length":14,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCUQ040EGAUiEwj2tPnxjNuIAxUrDbcAHbKwCNc=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/erosnow","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/erosnow","nofollow":true}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: erosnow"}}},{"startIndex":105,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCUQ040EGAUiEwj2tPnxjNuIAxUrDbcAHbKwCNdI75G3gJ7CwbBk","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnloZjFfVGVVUGU2ZWtEZWFrNW8zcVZuM3VLZ3xBQ3Jtc0ttVnllLW81WFpqSWRuUFR5ZGIyQVZfbVV5UGt1TXExSi1IU2k4Yk5yZUlJWkw0Zm9Qb3NaQnFiUDlIRG9QWlJMZ3hfMTRqTlhkM1F6eEtUa1VRWFhCQm42clcxdkdPa2tVd2lMemhPaHJYZFRUcS16TQ\u0026q=https%3A%2F%2Fgoo.gl%2FBEX4zD\u0026v=ZGEGEeANyO8","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnloZjFfVGVVUGU2ZWtEZWFrNW8zcVZuM3VLZ3xBQ3Jtc0ttVnllLW81WFpqSWRuUFR5ZGIyQVZfbVV5UGt1TXExSi1IU2k4Yk5yZUlJWkw0Zm9Qb3NaQnFiUDlIRG9QWlJMZ3hfMTRqTlhkM1F6eEtUa1VRWFhCQm42clcxdkdPa2tVd2lMemhPaHJYZFRUcS16TQ\u0026q=https%3A%2F%2Fgoo.gl%2FBEX4zD\u
